(23, 'Disney Planet - Café da Manhã com Remy & Emile - Karina Korn', NULL, 'Ratatouille', 10, '<p>Oferecido pela Disney &ndash; PIXAR, o Caf&eacute; da Manh&atilde; com Remy &amp; Emile aconteceu no espa&ccedil;o Brinquedoteca da Casa Cor S&atilde;o Paulo 2007, projetado pela arquiteta Karina Korn. Assista ao v&iacute;deo que mostra os personagens e trechos do filme Ratatouille.</p>', NULL, '2010-03-07 03:33:07', '2013-01-26 19:08:52', NULL, 29),
(59, 'Iluminação', NULL, 'Dica Decoração 2', 11, '<p>Que tipo de telha se usa numa casa contempor&acirc;nea?<br />\r\n(carta publicada na revista Arquitetura&amp;Constru&ccedil;&atilde;o fev/2007)</p>\r\n<p>Arquiteta Karina Korn responde:</p>\r\n<p>A escolha deve levar em conta o estilo do projeto, as necessidades t&eacute;cnicas da constru&ccedil;&atilde;o (por exemplo, a inclina&ccedil;&atilde;o da cobertura e o uso de modelos do tipo sandu&iacute;che para obter um melhor conforto termoac&uacute;stico) e o custo.</p>\r\n<p>A arquiteta Karina Korn, de S&atilde;o Paulo, esclarece que as constru&ccedil;&otilde;es modernas geralmente t&ecirc;m platibanda, esp&eacute;cie de fechamento que esconde o telhado, como na foto acima. Assim, as telhas podem ser simples, como as cer&acirc;micas, pois n&atilde;o ficar&atilde;o aparentes. - Para uma maior harmonia arquitet&ocirc;nica, a platibanda &eacute; limitada pela altura final do telhado - explica a arquiteta paulista. Nesses casos, a cobertura tem pouca inclina&ccedil;&atilde;o.</p>\r\n<p>H&aacute; ainda a op&ccedil;&atilde;o da laje, sem telhas - que deve obedecer a uma inclina&ccedil;&atilde;o m&iacute;nima para o escoamento da &aacute;gua e ser devidamente impermeabilizada. Caso voc&ecirc; prefira manter o telhado aparente, h&aacute; toda sorte de modelos de telhas: met&aacute;licas, de cer&acirc;mica, de concreto.<br />\r\n- Cada uma possui uma especifica&ccedil;&atilde;o de caimento e uso, e deve-se consultar o arquiteto e o fabricante - lembra Karina, que costuma evitar as de fibrocimento por causa da sua alta taxa de absor&ccedil;&atilde;o de calor. - Manter o telhado sempre limpo e ter cuidados com as calhas tamb&eacute;m influenciam na durabilidade da cobertura - completa Karina.</p>', NULL, '2010-04-12 04:09:58', '2010-06-15 02:15:37', NULL, 26),
