(62, 'Nova publicação Responsabilidade Social', NULL, 'Responsabilidade Social', 12, '<table cellspacing="0" cellpadding="0" width="366" bgcolor="#000000" align="center">\r\n    <tbody>\r\n        <tr>\r\n            <td class="Textodestaque">&quot; O sorriso de uma crian&ccedil;a n&atilde;o tem pre&ccedil;o...<br />\r\n            Hoje eu posso dizer que &quot;fiz parte&quot; de um projeto sem igual, e que deve servir de exemplo de cidadania e amor.<br />\r\n            Unindo for&ccedil;as, podemos,com certeza, construir um futuro melhor! &quot;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain"><span class="Textodestaque">O projeto Casa da Crian&ccedil;a tem como objetivo principal melhorar a qualidade de vida das crian&ccedil;as que vivem nas creches e abrigos.</span> Sendo assim, n&oacute;s profissionais selecionados para fazer parte deste projeto t&iacute;nhamos como compromisso usar a nossa habilidade profissional para projetar ambientes que obedecessem este requisito. E foi assim que tudo come&ccedil;ou...</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Fiquei encarregada de elaborar o projeto de uma sala de TV e um quarto para as &quot;meninas maiores&quot;, com idades entre 12 e 17 anos. S&atilde;o adolescentes. S&atilde;o meninas sofridas que foram tiradas de seus pais por maus tratos.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Dar melhor condi&ccedil;&atilde;o de moradia &eacute; uma das principais formas de melhorar a qualidade de vida.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">No Abrigo Santana ficou estabelecido pela coordena&ccedil;&atilde;o do Projeto Casa da Crian&ccedil;a que cada ambiente teria de apresentar para as crian&ccedil;as uma profiss&atilde;o. Isto para que essas crian&ccedil;as conhe&ccedil;am as v&aacute;rias carreiras que existem, e assim &quot;tomem gosto&quot; por alguma delas e se esforcem para &quot;serem algu&eacute;m na vida&quot;, e n&atilde;o caiam pelo mundo usando drogas, roubando, infelizmente aquilo que mais vemos pelo Brasil.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Para a sala de TV ficou estabelecida a profiss&atilde;o de modelo e para o dormit&oacute;rio da profiss&atilde;o de Comiss&aacute;ria de Bordo.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Foram feitas reuni&otilde;es com a assistente social que cuida do Abrigo Santana onde ficaram claras as necessidades das meninas que &quot;usariam&quot; estes ambientes. No Dormit&oacute;rio da Comiss&aacute;ria de Bordo dormiriam quatro meninas, e a Sala da Modelo seria usada por 18 meninas. Ent&atilde;o os projetos desses ambientes come&ccedil;aram a tomar forma.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Para os dois ambientes foram escolhidas as cores lil&aacute;s, azul, verde e pink. S&atilde;o cores que, pela experi&ecirc;ncia que eu tenho com quartos de meninas desta idade, s&atilde;o as suas preferidas. Posso at&eacute; dizer que s&atilde;o as cores das &quot;patricinhas&quot;, aquelas meninas que querem andar na moda e n&atilde;o se incomodam com exageros, la&ccedil;os, babados, mistura de cores vibrantes e etc.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">O cuidado de escolher as mesmas cores para os dois ambientes foi tomado para que os projetos tivessem uma unidade. No dormit&oacute;rio, foram colocadas 2 beliches, um grande arm&aacute;rio, uma bancada de estudos e uma estante pequena entre os beliches. Na sala, foi colocado um sof&aacute; branco, duas poltronas pink e um m&oacute;vel para TV, v&iacute;deo e som.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Essas eram as suas necessidades... precisavam ser m&oacute;veis pr&aacute;ticos, de f&aacute;cil manuten&ccedil;&atilde;o para que o Abrigo pudesse continuar o trabalho de manter tudo da mesma maneira que foi entregue.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">As beliches, arm&aacute;rio, estante e m&oacute;vel de TV s&atilde;o de laca branca, de f&aacute;cil manuten&ccedil;&atilde;o e resistentes. As poltronas tem um tecido f&aacute;cil de limpar e o sof&aacute; tem capa remov&iacute;vel sem sarja que pode ser retirada e lavada ali mesmo, sem estragar.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Com a ajuda de muitas pessoas e empresas pudemos arrecadar todos os m&oacute;veis dos ambientes, bem como TV, v&iacute;deo cassete, persianas, enfeites, lumin&aacute;rias, jogos de cama, banho, cobertores, brinquedos e at&eacute; material escolar para essas meninas. Foram doa&ccedil;&otilde;es maravilhosas, e sem essas pessoas o projeto n&atilde;o teria sido terminado. Tenho enorme gratid&atilde;o por aqueles que acreditaram no meu trabalho e o tornaram uma realidade.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">O projeto destes ambientes foi elaborado de maneira que as meninas da creche pudessem perceber que qualidade de vida n&atilde;o &eacute; uma exclusividade dos mais favorecidos. As crian&ccedil;as que s&atilde;o maltratadas hoje ser&atilde;o adultos que tamb&eacute;m maltratar&atilde;o amanh&atilde;, e podendo melhorar a vida dessas crian&ccedil;as hoje, estaremos apostando em um futuro muito mais promissor, muito melhor, n&atilde;o s&oacute; para elas, mas para todos n&oacute;s.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textodestaque">Este maravilhoso Projeto Casa da Crian&ccedil;a permite que as pessoas ajudem fazendo exatamente aquilo que elas sabem fazer... eu, por exemplo, dei de mim o que eu sei fazer de melhor para uma causa t&atilde;o nobre, uma causa que mereceu todo o meu empenho e dedica&ccedil;&atilde;o.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Com toda certeza, o meu maior pr&ecirc;mio ser&aacute; ver a alegria destas crian&ccedil;as ao voltarem para casa, uma vez que elas j&aacute; moravam neste mesmo abrigo e foram transferidas temporariamente para outros locais durante a obra.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Karina Korn</td>\r\n        </tr>\r\n    </tbody>\r\n</table>', NULL, '2010-05-13 01:50:54', '2010-05-13 01:53:44', NULL, 4),
(28, 'OLGA KRELL', NULL, 'OLGA KRELL', 13, '<p>Polonesa radicada no Brasil h&aacute; v&aacute;rios anos, a jornalista e arquiteta Olga Krell &eacute; unanimidade quando o assunto &eacute; decora&ccedil;&atilde;o, design e ambienta&ccedil;&atilde;o. <br />\r\n&nbsp; <br />\r\nH&aacute; tr&ecirc;s d&eacute;cadas, projetou e liderou a Casa Cl&aacute;udia, revista do grupo Abril de grande popularidade, s&iacute;mbolo deste segmento no Pa&iacute;s. Contratada por uma editora rival, Olga dirigiu a Arquitetura &amp; Decora&ccedil;&atilde;o, publica&ccedil;&atilde;o semelhante, tamb&eacute;m de grande aceita&ccedil;&atilde;o no mercado. Decidida a se tornar empres&aacute;ria, Olga deixou o projeto na segunda metade dos anos 90 para se tornar editora de sua pr&oacute;pria revista. Na defini&ccedil;&atilde;o da jornalista, o Espa&ccedil;o D &eacute; um produto mais elaborado, destinado a um leitor mais exigente. Na &uacute;ltima semana, Olga Krell esteve em Fortaleza para integrar o j&uacute;ri oficial da Casa Cor 2001. Em entrevista ao Caderno 3, Olga destacou o reconhecimento que os profissionais brasileiros de design e ambienta&ccedil;&atilde;o t&ecirc;m conquistado no exterior e o crescente interesse nacional pela revaloriza&ccedil;&atilde;o e a redescoberta do universo dom&eacute;stico. Este fen&ocirc;meno, segundo ela, seria uma consequ&ecirc;ncia dos problemas sociais e econ&ocirc;micos do Pa&iacute;s. Confira a seguir. <br />\r\n&nbsp; <br />\r\nQue espa&ccedil;o o Brasil ocupa hoje no universo da moda, do design e da arquitetura? Qual a &quot;cota&ccedil;&atilde;o&quot; internacional dos nossos profissionais? <br />\r\n&nbsp; <br />\r\nOlga Krell - Nas &aacute;reas de paisagismo, decora&ccedil;&atilde;o e arquitetura estamos no mesmo est&aacute;gio que Mil&atilde;o, Nova Iorque e Paris. A &uacute;nica diferen&ccedil;a que percebo &eacute; quanto a tecnologia empregada, que n&atilde;o est&aacute; t&atilde;o avan&ccedil;ada como em outros pa&iacute;ses. Agora, eu n&atilde;o acompanho tanto a moda, mas eu sei que a nossa cota&ccedil;&atilde;o neste setor est&aacute; subindo t&atilde;o rapidamente ou mais do que a decora&ccedil;&atilde;o. A mulher brasileira &eacute; uma mulher elegante. Eu sempre digo que a moda que est&aacute; sendo exposta em Paris, as brasileiras j&aacute; come&ccedil;aram a usar duas semanas antes. <br />\r\n&nbsp; <br />\r\nPor conta do &ecirc;xito desta produ&ccedil;&atilde;o nacional, &eacute; poss&iacute;vel afirmar que o Brasil j&aacute; possui uma tradi&ccedil;&atilde;oconsolidada nestas &aacute;reas? <br />\r\n&nbsp; <br />\r\nOlga Krell - Consolidada eu ainda n&atilde;o diria. Mas eu diria que nos &uacute;ltimos cinco anos esta imagem melhorou muito. O universo dom&eacute;stico voltou a ser valorizado e isto impulsiona o setor. Todos os problemas s&oacute;cio-econ&ocirc;micos do Pa&iacute;s provocaram uma redescoberta do lar que n&atilde;o existia h&aacute; cinco anos atr&aacute;s. Estamos come&ccedil;ando a achar que a nossa casa &eacute; o melhor lugar para ficar e descansar.</p>', NULL, '2010-03-14 03:05:32', '2011-05-27 21:43:30', NULL, 4),
(65, 'Daniel Libeskind', NULL, 'Daniel Libeskind', 13, '<p>Daniel Libeskind n&atilde;o v&ecirc; tecnologia como empecilho para arquitetos brasileiros.<br />\r\n&quot;Arquitetura &eacute; arte p&uacute;blica. &Eacute; linguagem, &eacute; comunica&ccedil;&atilde;o&quot;. As afirma&ccedil;&otilde;es foram feitas pelo arquiteto polon&ecirc;s naturalizado norte-americano Daniel Libeskind, criador, entre outros, do Museu Judaico em Berlim e da Freedom Tower, em constru&ccedil;&atilde;o no Ground Zero, em Nova York (EUA). Confira a entrevista...</p>', NULL, '2010-05-13 02:13:11', '2010-05-14 01:03:20', NULL, 3),
