(70, 'Casa Cor SP 2010', NULL, 'Casa Cor SP 2010', 15, '<table width="366" align="center" bgcolor="#000000" cellspacing="0" cellpadding="0">\r\n    <tbody>\r\n        <tr>\r\n            <td align="left"><span class="Textodestaque">CASA COR S&Atilde;O PAULO 2010<br />\r\n            26 de Maio a 14 de Julho de 2010<br />\r\n            Av. Lineu de Paula Machado, 1075 - Jockey Club de S&atilde;o Paulo - Cidade Jardim - SP<br />\r\n            Hor&aacute;rio: Ter&ccedil;a a S&aacute;bado, das 12:00hs &agrave;s 21:00hs<br />\r\n            Domingo, das 12:00hs &agrave;s 20:00hs</span></td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Com muita inova&ccedil;&atilde;o e criatividade, o Grupo CASA COR apresentar&aacute; uma id&eacute;ia ousada com a concep&ccedil;&atilde;o de tr&ecirc;s eventos simult&acirc;neos neste ano: a CASA COR 2010, maior mostra de arquitetura, decora&ccedil;&atilde;o e paisagismo da Am&eacute;rica Latina e terceira maior do mundo, o CASA HOTEL&cedil; voltado para o setor de turismo, e a estr&eacute;ia do CASA KIDS.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">O tema escolhido para a 23&ordf; CASA COR, a &ldquo;Sustentabilidade&rdquo;, est&aacute; mais do que em evid&ecirc;ncia e ganha cada vez mais import&acirc;ncia em todo mundo. Roberto Burle Marx, consagrado na hist&oacute;ria do paisagismo, ser&aacute; o homenageado deste ano, em comemora&ccedil;&atilde;o aos 100 anos de seu nascimento. Os visitantes da CASA COR poder&atilde;o conhecer ambientes produzidos por experts do mercado, com muita sofistica&ccedil;&atilde;o, conforto e estilo de vida, al&eacute;m de se descontrair com diversas op&ccedil;&otilde;es de entretenimento, como restaurantes, caf&eacute;s, &aacute;reas para compras, entre outros.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Ser&atilde;o mais de 140 arquitetos, decoradores, designers e paisagistas para projetar os espa&ccedil;os distribu&iacute;dos em uma &aacute;rea total de 44 mil m2. A concep&ccedil;&atilde;o dos tr&ecirc;s eventos torna a CASA COR a maior mostra do segmento das Am&eacute;ricas e a segunda maior do mundo, atr&aacute;s apenas para o Sal&atilde;o de Mil&atilde;o.</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">&nbsp;</td>\r\n        </tr>\r\n        <tr>\r\n            <td class="Textomain">Maiores informa&ccedil;&otilde;es: <a class="linkagenda" target="_blank" href="http://www.casacor.com.br/saopaulo/">www.casacor.com.br/saopaulo/ </a></td>\r\n        </tr>\r\n    </tbody>\r\n</table>', NULL, '2010-05-13 03:00:59', '2013-01-16 19:46:52', NULL, 3),
