(55, 'Arquiteta Karina Korn no programa Casas Espetaculares - 2006', NULL, 'Casas Espetaculares 2006', 10, '<p>A arquiteta e designer de interiores Karina Korn mostra o seu trabalho no programa Casas Espetaculares com Sevilha Nogueira. Confira os detalhes do projeto de decora&ccedil;&atilde;o de um apartamento, executado por Karina.</p>', NULL, '2010-04-12 03:00:47', '2013-01-26 19:11:09', NULL, 28),
(57, 'Tipo de Telha', NULL, 'Dica Decoração 1', 11, '<p>Que tipo de telha se usa numa casa contempor&acirc;nea?<br />\r\n(carta publicada na revista Arquitetura&amp;Constru&ccedil;&atilde;o fev/2007) <br />\r\n&nbsp;<br />\r\nArquiteta Karina Korn responde:<br />\r\n&nbsp;<br />\r\nA escolha deve levar em conta o estilo do projeto, as necessidades t&eacute;cnicas da constru&ccedil;&atilde;o (por exemplo, a inclina&ccedil;&atilde;o da cobertura e o uso de modelos do tipo sandu&iacute;che para obter um melhor conforto termoac&uacute;stico) e o custo.<br />\r\n&nbsp;<br />\r\nA arquiteta Karina Korn, de S&atilde;o Paulo, esclarece que as constru&ccedil;&otilde;es modernas geralmente t&ecirc;m platibanda, esp&eacute;cie de fechamento que esconde o telhado, como na foto acima. Assim, as telhas podem ser simples, como as cer&acirc;micas, pois n&atilde;o ficar&atilde;o aparentes. - Para uma maior harmonia arquitet&ocirc;nica, a platibanda &eacute; limitada pela altura final do telhado - explica a arquiteta paulista. Nesses casos, a cobertura tem pouca inclina&ccedil;&atilde;o.<br />\r\n&nbsp;<br />\r\nH&aacute; ainda a op&ccedil;&atilde;o da laje, sem telhas - que deve obedecer a uma inclina&ccedil;&atilde;o m&iacute;nima para o escoamento da &aacute;gua e ser devidamente impermeabilizada. Caso voc&ecirc; prefira manter o telhado aparente, h&aacute; toda sorte de modelos de telhas: met&aacute;licas, de cer&acirc;mica, de concreto.<br />\r\n- Cada uma possui uma especifica&ccedil;&atilde;o de caimento e uso, e deve-se consultar o arquiteto e o fabricante - lembra Karina, que costuma evitar as de fibrocimento por causa da sua alta taxa de absor&ccedil;&atilde;o de calor. - Manter o telhado sempre limpo e ter cuidados com as calhas tamb&eacute;m influenciam na durabilidade da cobertura - completa Karina.</p>', NULL, '2010-04-12 04:03:31', '2010-06-15 02:16:38', NULL, 28),
(60, 'Janelas', NULL, 'Dica Decoração 3', 11, '<p>&quot; O principal recurso utilizado na ilumina&ccedil;&atilde;o em parte dos 44 ambientes projetados na 2&ordf; edi&ccedil;&atilde;o brasileira do CAD Casa Arte &amp; Design foram os LEDs, tecnologia de baixo consumo el&eacute;trico e longa vida &uacute;til.</p>\r\n<p>A arquiteta Karina Korn assinou o ambiente intitulado Caf&eacute; Gazebo, onde o principal destaque foi a utiliza&ccedil;&atilde;o de pastilhas de coco que revestem a parede, parte do piso e o balc&atilde;o.</p>\r\n<p>&nbsp;Tamb&eacute;m projetada por Serradura, a ilumina&ccedil;&atilde;o foi feita somente com LEDs, sendo 39 lumin&aacute;rias com pot&ecirc;ncia de 1,4W e sete de 9W, fornecidos pela M&aacute;ximo Ilumina&ccedil;&atilde;o. Com isso, o gasto, que com l&acirc;mpadas convencionais chegaria a 1725W, foi reduzido para 117,6W, indo exatamente ao encontro da proposta sustent&aacute;vel da mostra.&quot;</p>\r\n<p>&nbsp;&quot; O principal recurso utilizado na ilumina&ccedil;&atilde;o em parte dos 44 ambientes projetados na 2&ordf; edi&ccedil;&atilde;o brasileira do CAD Casa Arte &amp; Design foram os LEDs, tecnologia de baixo consumo el&eacute;trico e longa vida &uacute;til.</p>\r\n<p>A arquiteta Karina Korn assinou o ambiente intitulado Caf&eacute; Gazebo, onde o principal destaque foi a utiliza&ccedil;&atilde;o de pastilhas de coco que revestem a parede, parte do piso e o balc&atilde;o.</p>\r\n<p>Tamb&eacute;m projetada por Serradura, a ilumina&ccedil;&atilde;o foi feita somente com LEDs, sendo 39 lumin&aacute;rias com pot&ecirc;ncia de 1,4W e sete de 9W, fornecidos pela M&aacute;ximo Ilumina&ccedil;&atilde;o. Com isso, o gasto, que com l&acirc;mpadas convencionais chegaria a 1725W, foi reduzido para 117,6W, indo exatamente ao encontro da proposta sustent&aacute;vel da mostra.&quot;</p>', NULL, '2010-04-12 04:16:33', '2010-06-15 02:17:19', NULL, 27),
(75, 'Nova publicação Home', NULL, 'Home', 16, '<p>O interesse pela arte sempre esteve presente na minha vida. Desde crian&ccedil;a gostava de fazer trabalhos manuais, desenhar e pintar. Como venho de uma fam&iacute;lia de profissionais na &aacute;rea de arquitetura, decora&ccedil;&atilde;o e constru&ccedil;&atilde;o, eu sempre pude acompanh&aacute;-los de perto, e assim aprendi desde cedo a lidar com esse tipo de trabalho. <br />\r\n&nbsp; <br />\r\nSou apaixonada pela minha profiss&atilde;o, e procuro mostrar isso nas obras que executo. Hoje, depois de 16 anos no mercado de trabalho, posso me considerar uma vencedora. Meus projetos s&atilde;o fruto de grande experi&ecirc;ncia na &aacute;rea de arquitetura e decora&ccedil;&atilde;o de interiores, aliados &agrave; intensa busca por novidades. Tenho ao meu lado uma equipe formada por profissionais jovens, com garra e perseveran&ccedil;a. Assim, aliamos vontade, determina&ccedil;&atilde;o e muito, muito trabalho. <br />\r\n&nbsp; <br />\r\nAl&eacute;m da exposi&ccedil;&atilde;o dos nossos projetos de trabalho, o site Karina Korn Arquitetura re&uacute;ne informa&ccedil;&otilde;es valiosas das &aacute;reas de arquitetura, decora&ccedil;&atilde;o e constru&ccedil;&atilde;o, apresentando as mais recentes novidades, agenda de eventos, dicas de decora&ccedil;&atilde;o e entrevistas com personalidades do mercado.&nbsp;</p>', NULL, '2010-05-14 02:02:34', '2010-05-14 02:02:58', NULL, 1),
