(69, 'Newsletter - jun/2010', NULL, 'News - jun/2010', 14, '<p>Comandada pelo uruguaio Carlos Pissani, a boutique de massas Pissani trouxe para S&atilde;o Paulo uma proposta inovadora de &quot;massas de grife&quot;. Saiba mais!</p>', NULL, '2010-05-13 02:46:27', '2010-06-15 02:48:39', NULL, 3),
(66, 'Olga Krell 2', NULL, 'Olga Krell 2', 13, '<p>Polonesa radicada no Brasil h&aacute; v&aacute;rios anos, a jornalista e arquiteta Olga Krell &eacute; unanimidade quando o assunto &eacute; decora&ccedil;&atilde;o, design e ambienta&ccedil;&atilde;o. <br />\r\n&nbsp; <br />\r\nH&aacute; tr&ecirc;s d&eacute;cadas, projetou e liderou a Casa Cl&aacute;udia, revista do grupo Abril de grande popularidade, s&iacute;mbolo deste segmento no Pa&iacute;s. Contratada por uma editora rival, Olga dirigiu a Arquitetura &amp; Decora&ccedil;&atilde;o, publica&ccedil;&atilde;o semelhante, tamb&eacute;m de grande aceita&ccedil;&atilde;o no mercado. Decidida a se tornar empres&aacute;ria, Olga deixou o projeto na segunda metade dos anos 90 para se tornar editora de sua pr&oacute;pria revista. Na defini&ccedil;&atilde;o da jornalista, o Espa&ccedil;o D &eacute; um produto mais elaborado, destinado a um leitor mais exigente. Na &uacute;ltima semana, Olga Krell esteve em Fortaleza para integrar o j&uacute;ri oficial da Casa Cor 2001. Em entrevista ao Caderno 3, Olga destacou o reconhecimento que os profissionais brasileiros de design e ambienta&ccedil;&atilde;o t&ecirc;m conquistado no exterior e o crescente interesse nacional pela revaloriza&ccedil;&atilde;o e a redescoberta do universo dom&eacute;stico. Este fen&ocirc;meno, segundo ela, seria uma consequ&ecirc;ncia dos problemas sociais e econ&ocirc;micos do Pa&iacute;s. Confira a seguir. <br />\r\n&nbsp; <br />\r\nQue espa&ccedil;o o Brasil ocupa hoje no universo da moda, do design e da arquitetura? Qual a &quot;cota&ccedil;&atilde;o&quot; internacional dos nossos profissionais? <br />\r\n&nbsp; <br />\r\nOlga Krell - Nas &aacute;reas de paisagismo, decora&ccedil;&atilde;o e arquitetura estamos no mesmo est&aacute;gio que Mil&atilde;o, Nova Iorque e Paris. A &uacute;nica diferen&ccedil;a que percebo &eacute; quanto a tecnologia empregada, que n&atilde;o est&aacute; t&atilde;o avan&ccedil;ada como em outros pa&iacute;ses. Agora, eu n&atilde;o acompanho tanto a moda, mas eu sei que a nossa cota&ccedil;&atilde;o neste setor est&aacute; subindo t&atilde;o rapidamente ou mais do que a decora&ccedil;&atilde;o. A mulher brasileira &eacute; uma mulher elegante. Eu sempre digo que a moda que est&aacute; sendo exposta em Paris, as brasileiras j&aacute; come&ccedil;aram a usar duas semanas antes. <br />\r\n&nbsp; <br />\r\nPor conta do &ecirc;xito desta produ&ccedil;&atilde;o nacional, &eacute; poss&iacute;vel afirmar que o Brasil j&aacute; possui uma tradi&ccedil;&atilde;oconsolidada nestas &aacute;reas? <br />\r\n&nbsp; <br />\r\nOlga Krell - Consolidada eu ainda n&atilde;o diria. Mas eu diria que nos &uacute;ltimos cinco anos esta imagem melhorou muito. O universo dom&eacute;stico voltou a ser valorizado e isto impulsiona o setor. Todos os problemas s&oacute;cio-econ&ocirc;micos do Pa&iacute;s provocaram uma redescoberta do lar que n&atilde;o existia h&aacute; cinco anos atr&aacute;s. Estamos come&ccedil;ando a achar que a nossa casa &eacute; o melhor lugar para ficar e descansar.</p>', NULL, '2010-05-13 02:16:18', '2010-05-14 01:03:41', NULL, 2),
(74, 'Nova publicação Perfil', NULL, 'Home', 5, '<p>O interesse pela arte sempre esteve presente na minha vida. Desde crian&ccedil;a gostava de fazer trabalhos manuais, desenhar e pintar. Como venho de uma fam&iacute;lia de profissionais na &aacute;rea de arquitetura, decora&ccedil;&atilde;o e constru&ccedil;&atilde;o, eu sempre pude acompanh&aacute;-los de perto, e assim aprendi desde cedo a lidar com esse tipo de trabalho. <br />\r\n&nbsp; <br />\r\nSou arquiteta e designer, formada em 1995 pela faculdade de Arquitetura e Urbanismo Mackenzie, e tenho tamb&eacute;m diversos cursos na &aacute;rea, inclusive o diploma de Designer de Interiores e Desenhista Publicit&aacute;ria pela Escola Panamericana de Arte. <br />\r\n&nbsp; <br />\r\nSou apaixonada pela minha profiss&atilde;o, e procuro mostrar isso nas obras que executo. Hoje, depois de 12 anos no mercado de trabalho, posso me considerar uma vencedora. Sou respeitada pelos meus clientes e colegas, e procuro dar o m&aacute;ximo de mim em cada trabalho.<br />\r\nMeus projetos s&atilde;o fruto de anos de experi&ecirc;ncia na &aacute;rea de arquitetura e decora&ccedil;&atilde;o de interiores, aliados &agrave; intensa busca por novidades. Tenho ao meu lado uma equipe formada por profissionais jovens, com garra e perseveran&ccedil;a para o trabalho. Assim, aliamos vontade, determina&ccedil;&atilde;o e muito, muito trabalho. <br />\r\n&nbsp; <br />\r\nJ&aacute; participei de v&aacute;rias mostras de decora&ccedil;&atilde;o como Casa Cor SP 2007, 2006, 2005, 2003 e 2002, CADDesign 2008 e 2007, Casa da Crian&ccedil;a 2002, The House 2001, al&eacute;m de vitrines, mesas decoradas, stands, lounges. <br />\r\n&nbsp; <br />\r\nTenho v&aacute;rias mat&eacute;rias publicadas em revistas como Casa Claudia, Viver Bem, Casa e Ambiente Beb&ecirc;, Quarto dos Filhos, Arquitetura e Constru&ccedil;&atilde;o, Home-Office, Revista Office, Casa e Mercado, Revistas na &aacute;rea de Hotelaria e de Gourmets, Jornais de grande circula&ccedil;&atilde;o.</p>', NULL, '2010-05-14 01:51:30', '2010-05-14 02:01:33', NULL, 1),
