(80, 'Esta é nova', NULL, 'Dica Decoração 4', 11, '<p>A arquiteta Karina Korn, de São Paulo, esclarece que as construções modernas geralmente têm platibanda, espécie de fechamento que esconde o telhado, como na foto acima. Assim, as telhas podem ser simples, como as cerâmicas, pois não ficarão aparentes. - Para uma maior harmonia arquitetônica, a platibanda é limitada pela altura final do telhado - explica a arquiteta paulista. Nesses casos, a cobertura tem pouca inclinação.<br />\r\n <br />\r\nHá ainda a opção da laje, sem telhas - que deve obedecer a uma inclinação mínima para o escoamento da água e ser devidamente impermeabilizada. Caso você prefira manter o telhado aparente, há toda sorte de modelos de telhas: metálicas, de cerâmica, de concreto.<br />\r\n- Cada uma possui uma especificação de caimento e uso, e deve-se consultar o arquiteto e o fabricante - lembra Karina, que costuma evitar as de fibrocimento por causa da sua alta taxa de absorção de calor. - Manter o telhado sempre limpo e ter cuidados com as calhas também influenciam na durabilidade da cobertura - completa Karina.</p>', NULL, '2010-06-15 02:20:13', '2013-06-10 14:05:06', NULL, 29),
