(208, 'Quarto de Vestir do Hóspede - Karina Korn Arquitetura - Casa Cor SP 2006', NULL, 'Casa Cor 2006 - Quarto de Vestir do Hóspede', 10, '<p>Arquiteta Karina Korn fala sobre o seu espa&ccedil;o projetado para a Casa Cor SP 2006 - Quarto de Vestir do H&oacute;spede - onde utilizou Shggy Rayon no piso da By Kamy Tapetes.</p>', NULL, '2013-01-26 19:13:51', '2013-01-26 19:16:50', NULL, 27),
(209, 'Arquiteta Karina Korn visita a Brentwood', NULL, 'Brentwood 2006', 10, '<p>A arquiteta e designer de interiores Karina Korn visitou a loja Brentwood no lan&ccedil;amento da sua cole&ccedil;&atilde;o 2006 inspirada em arte, hist&oacute;ria, literatura e moda: Arquitetura e Decora&ccedil;&atilde;o.</p>', NULL, '2013-01-26 19:19:32', '2013-01-26 19:20:47', NULL, 26),
(210, 'Cozinha de Praia - Karina Korn Arquitetura - Casa Cor SP 2005', NULL, 'Casa Cor SP 2005 - Cozinha de Praia', 10, '<p>Arquiteta Karina Korn fala sobre o seu espa&ccedil;o projetado para a Casa Cor SP 2005 - Cozinha de Praia. Partindo do conceito moderno da cozinha como espa&ccedil;o de conviv&ecirc;ncia e experimenta&ccedil;&atilde;o, o ambiente incorpora eletrodom&eacute;sticos de a&ccedil;o inox e o pr&aacute;tico Corian.</p>', NULL, '2013-01-26 19:21:58', '2013-01-26 19:26:18', NULL, 25),
(211, 'Boulangerie - Karina Korn Arquitetura - Casa Cor SP 2003', NULL, 'Casa Cor 2003 - Boulangerie', 10, '<p>Confira a Boulangerie - espa&ccedil;o projetado pela Arquiteta Karina Korn para a Casa Cor SP 2003. &quot;A parte gastron&ocirc;mica da Casa Cor promete ser uma atra&ccedil;&atilde;o &agrave; parte. Os p&atilde;es da Boulangerie Sofitel v&atilde;o abastecer a Boutique dos P&atilde;es. Descontra&ccedil;&atilde;o e funcionalidade s&atilde;o os principais pontos da Boulangerie&quot;.</p>', NULL, '2013-01-26 19:27:28', '2013-01-26 19:29:28', NULL, 24),
(212, 'Banheiro Público Masculino - Karina Korn Arquitetura - Casa Cor SP 2002', NULL, 'Casa Cor 2002 - Banheiro Público Masculino', 10, '<p>A Arquiteta Karina Korn elaborou o espa&ccedil;o Banheiro P&uacute;blico Masculino projetado para a Casa Cor SP 2002. Confira como ficou o ambiente da exposi&ccedil;&atilde;o de S&atilde;o Paulo.</p>', NULL, '2013-01-26 19:31:02', '2013-01-26 19:33:18', NULL, 23);
